import React from "react";
import { useState } from "react";
import {BrowserRouter as Router, Route, Routes, Link, useNavigate} from 'react-router-dom'
import Card from './card'
import Signup from "./signup";
import './animation.css'

const Navigation = ()=>{
    const navigate = useNavigate()
    const [isflip, setisflip] = useState(true)
    const navigating=(path)=>{
        setisflip(!isflip)
        navigate(path)
    }
    return(
        <nav>
            <Link to='/Signup' onClick={()=>navigating('/Signup')} className={isflip?'flipped':''}>Signup</Link>
            <Link to='/Signin' onClick={()=>navigating('/Signin')} className={isflip?'':'flipped'}>SIgnin</Link>
        </nav>
    )
}

const App =()=>{
    return(
        <Router>
            <Routes>
                <Route path="/Signup" element={<Signup/>}/>
                <Route path="/Signin" element={<Card/>}/>
                <Route path="/" element={<Card/>}/>
            </Routes>
            <Navigation/>
        </Router>
       


    )



}


export default App
